* { margin: 0; padding: 0; box-sizing: border-box; }
body { font-family: Helvetica, Arial, sans-serif; font-size: 16px; }

/* Test 1: Default line-height (normal) */
.test1 { background: #e3f2fd; margin-bottom: 10px; }

/* Test 2: Explicit line-height */
.test2 { background: #f3e5f5; line-height: 1.5; margin-bottom: 10px; }

/* Test 3: Line-height in px */
.test3 { background: #e8f5e9; line-height: 24px; margin-bottom: 10px; }

/* Test 4: Multiple lines - cumulative height test */
.test4 { background: #fff3e0; margin-bottom: 10px; }
